interface IShowSumProps{
    calSum: any,
    count: number
}

function ShowSum({ calSum, count }: IShowSumProps){

    return (
        <div>
            Cal Sum is:  {calSum}
            count: {count}
        </div>
    )
}

export default ShowSum
